import React from 'react';


const Marker = (props) => {
    const createMarkers = props.address.map((object, index)=>{
        if (Object.keys(object).length === 0){
         return (
             <>
             </>
         )
        } else {
        return (
            <div className="marker" 
            style={{ cursor: 'pointer'}}
            position={object}
            key={index} 
            defaultCenter={object}/>
        )
        }
    })
    return (
      <>
          {createMarkers}
      </>
    )
  };
  export default Marker
